function HWL_setting_updated()
{
	lastHWLchange = Date.now();
	HWLupdateRequested = true;
}

function updateHWLsettings()
{
	if(HWLupdateRequested == true)
	{
		HWLupdateRequested = false;
		var hwlenable = HWL_enable == true ? 0x01 : 0x00;
		var hwleffectMode;
		if(HWL_effectMode == "Rainbow Wave") { hwleffectMode = 1; }
		else if(HWL_effectMode == "Rainbow Cycle") { hwleffectMode = 2; }
		else if(HWL_effectMode == "Solid Color") { hwleffectMode = 3; }
		else if(HWL_effectMode == "Breathing Color") { hwleffectMode = 4; }
		var hwlreturn = HWL_return == true ? 0x01 : 0x00;
		var hwlcolor = hexToRgb(HWL_color);
		var statusledenable = StatusLED_enable == true ? 0x01 : 0x00;
		var colorcompressionenable = ColorCompression_enable == true ? 0x01 : 0x00;
			
		let packet = [0x00, 0x00, 0x00, 0x00, 0xBB, hwlenable, hwlreturn, HWL_returnafter, hwleffectMode, HWL_effectSpeed, HWL_brightness, hwlcolor[0], hwlcolor[1], hwlcolor[2], statusledenable, colorcompressionenable ];
		device.write(packet, 65);
	}
}

